import brouchres from "./images/brouchres.jpg";
const Sdata = [
  {
    img: brouchres,
    title: "web develoment",
    text: "this is text",
  },
  {
    img: brouchres,
    title: "web dent",
    text: "this is na",
  },
  {
    img: brouchres,
    title: "webeveloment",
    text: "this is a",
  },
];

export default Sdata;
